import React from "react";
import { useParams } from "react-router-dom";

const StoreDetailPage: React.FC = () => {
  const { id } = useParams<{ id: string }>();

  return (
    <div>
      <h1>店舗詳細ページ</h1>
      <p>店舗ID: {id}</p>
    </div>
  );
};

export default StoreDetailPage;
